/* Gists */
.gist .gist-file,
.gist .gist-data,
.gist .gist-meta,
.gist .highlight {
  border: none;
  background-color: var(--sag-bg-700);
}

.gist .blob-code-inner {
  color: #ddd;
}

.gist .pl-k {
  color: var(--sag-purple);
}

.gist .pl-ent {
  color: var(--sag-yellow);
}

.gist .pl-c1,
.gist .pl-s .pl-v {
  color: var(--sag-blue);
}

.gist .pl-smi,
.gist .pl-s .pl-s1 {
  color: var(--sag-purple);
}

.gist .pl-v,
.gist .pl-smw {
  color: var(--sag-red);
}

.gist .pl-e,
.gist .pl-en {
  color: var(--sag-yellow);
}

.gist .pl-s,
