        It looks fine I guess, but a better solution should be found */
        filter:invert(0.8);
    }

    .oo-ui-textInputWidget .oo-ui-inputWidget-input {
        background-color:#444;
        color:#FFF;
    }

    .warningbox {
        background-color:#443;
    }

    /* Wikieditor */

    .wikiEditor-ui-toolbar {
        background-color:#444;
    }

    .wikiEditor-ui-toolbar .tabs span.tab a,
    .wikiEditor-ui-toolbar .tabs span.tab a:visited {
        background-image:url('data:image/svg+xml;utf8,<svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" viewBox="0 0 16 16"><path d="m5 4 4 4-4 4 1 1 5-5-5-5z" fill="%23FFF"/></svg>');
    }

    .mw-editform #wpTextbox1 {
        background-color:#333;
        color: white;
    }

    .menuSwitcher {
        background-color:#333 !important;
    }

    .editMenus-button {
        background-color:#444;
        border:outset 2px #888;
        border-radius:0.25em;
    }

    .menuSwitcher-help-button,
    .menuSwitcher-help-button:hover,
    .menuSwitcher-hide-button,
    .menuSwitcher-hide-button:hover {
        color:#FFF !important;
    }

    .oo-ui-popupToolGroup-handle>span {
        filter:invert(1);
    }

    .oo-ui-popupToolGroup.oo-ui-widget-enabled > .oo-ui-popupToolGroup-handle:hover {
        background-color:#222;
    }

    /* Central Notice Banner */

    .cnotice {
        background-color: #333 !important;
        border: 1px solid #444;
    }

    .cnotice-toggle-box {
        -webkit-filter: invert(100%);
        filter: invert(100%);
    }

    div[style*="background:#FCFCFC"] {
	    background:#263F1E !important
    }

    /* Preferences */

    .client-js #preferences {
        border: 1px solid #888 !important;
        background-color: #444 !important;
    }

    .client-js #preferences legend {
        color: #ededed;
    }

    .mw-prefs-tabs-wrapper.oo-ui-panelLayout-framed {
        border-color: #888 !important;
    }

    /* Page Preview Options dialog */
    #mwe-popups-settings {
        background-color: #333 !important;
    }

    #mwe-popups-settings main form label > span {
        color: #fff !important;
    }

    .mw-ui-icon-popups-close::before {
        filter: invert(100%) !important;
    }

    .mwe-popups-overlay {
        background-color: rgba(0, 0, 0, 0.6) !important;
    }

    /* Minor fixes */

    .app-badges .footer-sidebar-content {
        background-color: #222 !important;
    }

    .mw-mmv-info-box {
        background-color: #111 !important;
    }

    :root {
        --wiki-logo: url("data:image/png;base64,");
    }

/* Mobile version */

    #mw-mf-page-center {
        background: none !important;
    }

    .hatnote.navigation-not-searchable {
        background: transparent !important;
    }

    .header-container.header-chrome {
        background-color: #222 !important;
    }

    .branding-box img {
        filter: invert(100%);
    }

    .minerva__tab-container .minerva__tab.selected {
        background-color: #444;
        border-bottom: 2px solid #666;
        padding: 6px;
    }

/* French version */

    #accueil_2017_en-tete {
        background-image: none !important;
    }

    .mw-logo-container, .mw-ui-icon, .searchButton {
        filter: invert(100%);
    }

    .mw-article-toolbar-container {
        background: none !important;
    }

    #mw-head {
        height: 40px !important;
    }

    .mw-body {
        margin-top: 1px !important;
        border-top: none;
    }

    .bandeau-section {
        background-color: #333 !important;
        border: 1px solid #666 !important;
     }

    .autres-projets {
        background-color: #333 !important;
        border: 1px solid #666 !important;
    }

    .mw-page-container {
        background-color: #222 !important;
        border: none;
    }

    .mw-widget-dateInputWidget-handle,
    .oo-ui-widget,
    .uls-search,
    .uls-language-list,
    #uls-settings-block,
    .legendtextlike,
    .wvui-input__input,
    .wvui-button,
    .wvui-typeahead-search__suggestion,
    .wvui-typeahead-suggestion__title,
    .wvui-typeahead-search__suggestions__footer {
        background-color: #333 !important;
        color: #ddd !important;
    }

    #mw-sidebar-button {
        background-color: #ddd !important;
    }

    .mw-ui-button {
        border: none !important;
    }

    #p-personal {
        filter: invert(90%);
    }

    .wvui-typeahead-suggestion__thumbnail {
        background-color: #aaa !important; /* Temporary filling while fixing the thumbnail previews in searchbar */
    }

    #mw-panel.mw-sidebar {
        background: #222 !important;
    }

    .bloc {
        background-color: #444 !important;
    }

    #left-navigation {
        margin-left: 0 !important;
    }

/* German version */

    #hauptseite h2 {
        background: inherit;
        border: none;
    }

    #hauptseite .inhalt {
        background: inherit;
        border: none;
    }

    #qualitaetssicherungstext {
        background-color: #444 !important;
        border: 1px solid #666 !important;
    }

