body,
.header-outer {
  color: white;
  background: var(--sag-bg-500);
}

.header-outer {
  border-bottom-color: var(--sag-border);
}

.header-title h1 {
  color: #ccc
}

searchBox input {
  border-color: var(--sag-border);
  color: white
}
.searchBox ::-webkit-input-placeholder {
  /* WebKit, Blink, Edge */
  color: white;
}
.searchBox ::-moz-placeholder {
  /* Mozilla Firefox 19+ */
  color: #ccc;
}
#sidebar-top {
  border-color: var(--sag-bg-900);
}
/*main post*/
#main .post .title a {
  color: white;
}
#main .post .title a:hover {
  color: var(--sag-accent-secondary);
}

a, a:visited {
  color: var(--sag-accent-secondary);
}

a:hover {
  color: var(--sag-accent-primary);
}

#main .post .post-header .caption,
#main .post .post-header .labels-caption,
#main .post .post-footer .caption,
#main .post .post-footer .labels-caption {
  color: #ccc;
}
#main .post .tr-caption {
  color: white;
}
.post-header .publishdate {
  color: #ccc;
}
.post .post-content {
  color: white;
}
/* Another old-style caption. */
.post-content div i,
.post-content div + i {
  color: white;
}

.post-author, .byline-author {
    color: #ccc;
}

/* Hide that weird sidebar search thing idk */
.col-right {
  display: none;
}

.col-main-wrapper {
  display: flex;
  justify-content: center;
  float: none;
}

.col-main {
